  <div>
    <Header />
    {/* Main Content */}
    <Container maxW="container.md" flex="1" minHeight="100vh">
      <Heading mb={6}>Welcome to Level 2 Website</Heading>
      <Text fontsize='x1' mb={4}>
        This is Level 2 simple applicatio ndemonstration
